import React, { useState } from 'react';
import profilePic from './images/profile.jpeg'; 
import post1 from './images/img1.jpeg';
import post2 from './images/img2.jpeg';
import post3 from './images/img3.jpeg';
import post4 from './images/img4.jpeg';
import post5 from './images/img5.jpeg';
import post6 from './images/img6.jpeg';
import './Profile.css'; 
import { FiFilter, FiMoreVertical } from "react-icons/fi"; // Import icons
import Navbar from './Navbar';

function Profile() {
  const [showFilter, setShowFilter] = useState(false);
  const [openMenus, setOpenMenus] = useState({}); // Track which post menu is open

  // Toggle dropdown for a specific post
  const toggleMenu = (index) => {
    setOpenMenus((prev) => {
      const updatedMenus = { ...prev };
      Object.keys(updatedMenus).forEach((key) => {
        updatedMenus[key] = false; // Close all other menus
      });
      updatedMenus[index] = !prev[index]; // Toggle the clicked menu
      return updatedMenus;
    });
  };

  const posts = [post1, post2, post3, post4, post5, post6];

  return (
    <div>
      <Navbar /> 

      {/* Centered Profile Section */}
      <div style={{ display: "flex", justifyContent: "center", marginTop: "80px" }}>
        <div className="profile-container">

          {/* Profile Header */}
          <div className="profile-header">
            <div className="profile-info-container">
              <img src={profilePic} alt="Profile" className="profile-pic" />
              <div className="profile-info">
                <h2 className="username">john_doe</h2>
                <div className="profile-stats">
                  <span><strong>150</strong> Posts</span>
                  <span><strong>2.3k</strong> Followers</span>
                  <span><strong>980</strong> Following</span>
                </div>
                <p className="bio">üåç Web Developer | üì∏ Photography Lover | üöÄ Tech Enthusiast</p>
              </div>
            </div>

            {/* Filter Icon & Dropdown */}
            <div className="filter-wrapper">
              <div className="filter-icon" onClick={() => setShowFilter(!showFilter)}>
                <FiFilter size={24} />
              </div>

              {showFilter && (
                <div className="filter-menu">
                  <ul>
                    <li>Newest First</li>
                    <li>Oldest First</li>
                    <li>Most Liked</li>
                    <li>Least Liked</li>
                  </ul>
                </div>
              )}
            </div>
          </div>

          {/* Instagram-Style Post Grid */}
          <div className="posts-grid">
            {posts.map((post, index) => (
              <div key={index} className="post-container">

                {/* Three-dot Menu */}
                <div className="post-menu">
                  <FiMoreVertical size={20} onClick={() => toggleMenu(index)} className="menu-icon" />

                  {openMenus[index] && (
                    <div className="post-dropdown">
                      <ul>
                        <li onClick={() => alert("Deleting post...")}>Delete</li>
                        <li onClick={() => alert("Sharing post...")}>Share</li>
                        <li onClick={() => alert("Reporting post...")}>Report</li>
                      </ul>
                    </div>
                  )}
                </div>

                {/* Post Image */}
                <img src={post} alt={`Post ${index + 1}`} className="post-image" />
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
}

export default Profile;
